  income DECIMAL,
  loan_amount DECIMAL
);

CREATE TABLE loan_history (
  customer_id INT PRIMARY KEY,
  loan_id INT,
  loan_date DATE,
  loan_amount DECIMAL
);

CREATE TABLE loan_risk_analysis (
  customer_id INT PRIMARY KEY,
  risk_score INT,
  loan_status VARCHAR(50)
);

CREATE TABLE credit_scores (
  id INT PRIMARY KEY,
